  <body>
    <div style="font-family:arial; font-size:75%; min-width: 310px; margin: 0 auto">
      <h1 style="center">Rate by Run</h1>
    </div>
    <svg id="run" style="min-width: 310px; height: 700px; margin: 0 auto"></svg>
    <div style="font-family:arial; font-size:75%; min-width: 310px; margin: 0 auto">
      Run&nbsp;<sub>min</sub>:&nbsp;<input id="runXMin"/>;
      Run&nbsp;<sub>max</sub>:&nbsp;<input id="runXMax"/>;
      Rate&nbsp;<sub>min</sub>:&nbsp;<input id="runYMin"/>;
      Rate&nbsp;<sub>max</sub>:&nbsp;<input id="runYMax"/>;
      <button onclick="applyRunDomains()">Apply</button>
      <button onclick="resetRunDomains()">Reset</button>
    </div>
    <script>
      var runData = [{"color": "#c0c0c0", "values": [{"y": 26019.881904709702, "x": 5}, {"y": 41484.037060432303, "x": 10}, {"y": 52887.456559517894, "x": 15}, {"y": 60204.708586920366, "x": 20}, {"y": 66345.773092954943, "x": 25}, {"y": 83350.794037394968, "x": 50}, {"y": 102757.05938440573, "x": 100}, {"y": 115280.4614663924, "x": 200}], "key": "Sending"}, {"color": "#000000", "values": [{"y": 26019.862622931709, "x": 5}, {"y": 41484.040658324106, "x": 10}, {"y": 52887.491650543823, "x": 15}, {"y": 60204.692353394807, "x": 20}, {"y": 66345.743600092726, "x": 25}, {"y": 83350.515987885476, "x": 50}, {"y": 102755.74181575417, "x": 100}, {"y": 115278.68646451451, "x": 200}], "key": "Receiving"}]

      var runChart
      var runXMin = document.getElementById("runXMin"),
          runXMax = document.getElementById("runXMax"),
          runYMin = document.getElementById("runYMin"),
          runYMax = document.getElementById("runYMax")

      var applyRunDomains = function() {
        runChart.xDomain([runXMin.value, runXMax.value])
        runChart.yDomain([runYMin.value, runYMax.value])
        runChart.update()
      }

      var resetRunDomains = function() {
        runChart.xDomain(null)
        runChart.yDomain(null)
        runChart.update()
      }

      nv.addGraph({
        generate: function() {
          var svg = d3.select('#run')
          runChart = nv.models.lineChart()
          runChart
            .width(svg.attr('width'))
            .dispatch.on('renderEnd', function(){
              var xDomain = runChart.xAxis.domain(),
                  yDomain = runChart.yAxis.domain()
              runXMin.value = xDomain[0]
              runXMax.value = xDomain[1]
              runYMin.value = yDomain[0]
              runYMax.value = yDomain[1]
            })

          runChart.xAxis
            .axisLabel("Run")
            .showMaxMin(false)

          runChart.yAxis
            .axisLabel("Rate, QpS")
            .showMaxMin(false)

          svg.datum(runData).call(runChart)

          return runChart
        },
        callback: function(graph) {
            window.onresize = function() {
                var svg = d3.select('#run')
                graph.width(svg.attr('width'))
                svg.call(graph)
            };
        }
      })
    </script>

      nv.addGraph({

          var svg = d3.select('#latency')
          latencyChart = nv.models.lineWithFocusChart()
          latencyChart
            .width(svg.attr('width'))

          latencyChart.xScale(d3.scale.log())

          latencyChart.xAxis
            .tickFormat(function(d) {
              if (d == null) {
                return 'N/A'
              }

              if (d > 999) {
                return d3.format(',.0f')(d/1000) + 'k'
              }

              if (d < 1000 && d > 0.999) {
                return d3.format(',.0f')(d)
              }

                return  d3.format(',.1f')(d)
              }

                return d3.format(',.2f')(d)
              }

              return d3.format(',.3f')(d)
            })
            .axisLabel("time, ms")
            .showMaxMin(false)

          latencyChart.xAxis
            .axisLabel("time, ms")
            .showMaxMin(false)

          latencyChart.yAxis
            .axisLabel("count, %")
            .showMaxMin(false)

          svg.datum(latencyData).call(latencyChart)

          return latencyChart
        },
        callback: function(graph) {

            };

      var queueChart
      var queueYMin = document.getElementById("queueYMin"),
          queueYMax = document.getElementById("queueYMax")

      var applyLatencyDomains = function() {
        queueChart.yDomain([queueYMin.value, queueYMax.value])
        queueChart.update()
      }

      var resetLatencyDomains = function() {
        queueChart.yDomain(null)
        queueChart.update()
      }

      nv.addGraph({
        generate: function() {
          var svg = d3.select('#queue')
          queueChart = nv.models.lineWithFocusChart()
          queueChart
            .width(svg.attr('width'))
            .dispatch.on('renderEnd', function(){
              var yDomain = queueChart.yAxis.domain()
              queueYMin.value = yDomain[0]
              queueYMax.value = yDomain[1]
            })

          queueChart.xAxis
            .axisLabel("time, ms")
            .showMaxMin(false)

          queueChart.yAxis
            .axisLabel("count")
            .showMaxMin(false)

          svg.datum(queueData).call(queueChart)

          return queueChart
        },
        callback: function(graph) {
            window.onresize = function() {
                var svg = d3.select('#queue')
                graph.width(svg.attr('width'))
                svg.call(graph)
            };
        }
      })
